package MockWeb;

package LWP::UserAgent;

use JSON::XS;
our $res = decode_json join('', <DATA>);

use HTTP::Response;
use Storable 'thaw';

$INC{'LWP/UserAgent.pm'} = 'mocked';

sub new {
    return bless {};
}

sub agent {

}

sub env_proxy {

}

sub get {
    my $self = shift;
    my $url = shift;
    
    my $raw = $res->{$url};

    if ($raw) {
        my $r = thaw($raw);

        return $r;
    }
    else {
        die "No stored response for $url (" . join('', keys %{$res}) .')';
    }
}

