opp_kallkritik\" /></a><h2><a href=\"https://www.iis.se/internet-for-alla/reportage/samhalle/kan-du-konsten-att-kolla-kallan\">Kan du konsten att kolla k\u00c3\u00a4llan?</a></h2><small><a href=\"https://www.iis.se/internet-for-alla/guider\">Internetguider</a></small><p><a href=\"https://www.iis.se/internet-for-alla/reportage/samhalle/kan-du-konsten-att-kolla-kallan\">I den nyutgivna Internetguiden \u00e2\u0080\u009dK\u00c3\u00a4llkritik p\u00c3\u00a5 Internet\u00e2\u0080\u009d ber\u00c3\u00a4ttar Kristina Alexanderson, projektledare f\u00c3\u00b6r .SE:s skolt\u00c3\u00a4vling Webbstj\u00c3\u00a4rnan, om grunderna f\u00c3\u00b6r k\u00c3\u00a4llkritik och ger goda r\u00c3\u00a5d om hur man praktiskt kan pr\u00c3\u00b6va sanningshalten i s\u00c3\u00a5dant man l\u00c3\u00a4ser, ser eller h\u00c3\u00b6r p\u00c3\u00a5 Internet.</a></p></li>\n<li id=\"post_preview-226\" class=\"widget widget_post_preview\"><a href=\"https://www.iis.se/blogg/cispa\"><img width=\"300\" height=\"170\" src=\"/docs/justice1-300x170.jpg\" class=\"attachment-300-thumb wp-post-image\" alt=\"justice\" title=\"justice\" /></a><h2><a href=\"https://www.iis.se/blogg/cispa\">Efter SOPA \u00e2\u0080\u0093 s\u00c3\u00a4g hej till CISPA</a></h2><small><a href=\"https://www.iis.se/om-se/se-bloggen\">.SE-bloggen</a></small><p><a href=\"https://www.iis.se/blogg/cispa\">Precis n\u00c3\u00a4r vi trodde att de f\u00c3\u00a5tt slut p\u00c3\u00a5 akronymer inom den amerikanska lagstiftningsapparaten s\u00c3\u00a5 \u00c3\u00a4r nu ett nytt lagf\u00c3\u00b6rslag p\u00c3\u00a5 v\u00c3\u00a4g genom kongressen \u00e2\u0080\u0093 CISPA \u00e2\u0080\u0093 \u00c3\u00a4nnu ett lagf\u00c3\u00b6rslag f\u00c3\u00b6r att st\u00c3\u00a4vja kriminalitet p\u00c3\u00a5 bekostnad av Internetanv\u00c3\u00a4ndarnas integritet.</a></p></li>\n<li id=\"post_preview-216\" class=\"widget widget_post_preview\"><a href=\"https://www.iis.se/blogg/facebook-fluga-eller-fralsare\"><img width=\"300\" height=\"170\" src=\"/docs/facebookglases-300x170.jpg\" class=\"attachment-300-thumb wp-post-image\" alt=\"facebookglases\" title=\"facebookglases\" /></a><h2><a href=\"https://www.iis.se/blogg/facebook-fluga-eller-fralsare\">Facebook \u00e2\u0080\u0093 fluga eller fr\u00c3\u00a4lsare?</a></h2><small><a href=\"https://www.iis.se/om-se/se-bloggen\">.SE-bloggen</a></small><p><a href=\"https://www.iis.se/blogg/facebook-fluga-eller-fralsare\">Hur m\u00c3\u00a5nga anv\u00c3\u00a4nder Facebook? Hur ofta anv\u00c3\u00a4nder man Facebook? Enkla fr\u00c3\u00a5gor som ber\u00c3\u00b6r och uppr\u00c3\u00b6r. S\u00c3\u00a5 fort n\u00c3\u00a5gon kommer med \u00e2\u0080\u009dFacebookfakta\u00e2\u0080\u009d ser vi hur l\u00c3\u00a4tt det sprids och ocks\u00c3\u00a5 hur l\u00c3\u00a4tt det missf\u00c3\u00b6rst\u00c3\u00a5s.</a></p></li>\n\t\t\t</ul>\n\t\t\t<br class=\"clear\" />\n\t\t\t\n\n\t\t\t<ul class=\"newsCol noTopMargin\">\n\t\t\t\t<li id=\"post_preview-184\" class=\"widget widget_post_preview\"><a href=\"https://www.iis.se/domaner/domankunskap\"><img width=\"300\" height=\"170\" src=\"/docs/domannamnsguideframsida-300x170.jpg\" class=\"attachment-300-thumb wp-post-image\" alt=\"domannamnsguideframsida\" title=\"domannamnsguideframsida\" /></a><h2><a href=\"https://www.iis.se/domaner/domankunskap\">Dom\u00c3\u00a4nkunskap \u00e2\u0080\u0093 en grundkurs</a></h2><small><a href=\"https://www.iis.se/domaner\">Dom\u00c3\u00a4ner</a></small><p><a href=\"https://www.iis.se/domaner/domankunskap\">M\u00c3\u00b6jligheten att registrera och anv\u00c3\u00a4nda dom\u00c3\u00a4nnamn har f\u00c3\u00b6renklat utvecklingen av Internet i v\u00c3\u00a4rlden och skapat f\u00c3\u00b6ruts\u00c3\u00a4ttningar f\u00c3\u00b6r m\u00c3\u00a4nniskor utan specifika tekniska kunskaper att anv\u00c3\u00a4nda n\u00c3\u00a4tet. H\u00c3\u00a4r kan du l\u00c3\u00a4ra dig mer om dom\u00c3\u00a4nnamn, hur de anv\u00c3\u00a4nds och v\u00c3\u00a4rdet av att ha ett eget.</a></p></li>\n<li id=\"post_preview-190\" class=\"widget widget_post_preview\"><a hre